import React from 'react';
import { Link } from 'react-router-dom';
import './FuelQuoteForm.css'; // Import the CSS file

const Login = () => {
  return (
    <div>
        <div className="title">
            <h2>Login</h2>
        </div>
        <div className="form-container"> {/* Apply form-container class */}
        {/* Login Form */}
        <form className="fuel-quote-form"> {/* Apply fuel-quote-form class */}
            <div className="form-group">
            <label htmlFor="username">Username:</label>
            <input type="text" id="username" className="form-control" /> {/* Adjusted class name for standardization */}
            </div>
            <div className="form-group">
            <label htmlFor="password">Password:</label>
            <input type="password" id="password" className="form-control" /> {/* Adjusted class name for standardization */}
            </div>

            {/* Button Container */}
            <div className="button-container">
                <button type="submit" className="button-login">Login</button>

            </div>
            <Link to="/register">
                    <button type="button" className="button-register">Register</button>
                </Link>
        </form>
        </div>
    </div>
  );
};

export default Login;
